import classes from './AvailableMeals.module.css';
import Cart from '../UI/Cart';
import MealItem from './HandleMeals/MealItem';
const DUMMY_MEALS = [
    {
      id: 'm1',
      name: 'Sushi',
      description: 'Finest fish and veggies',
      price: 'Rs 400',
    },
    {
      id: 'm2',
      name: 'Schnitzel',
      description: 'A german specialty!',
      price: 'Rs 500',
    },
    {
      id: 'm3',
      name: 'Barbecue Burger',
      description: 'American, raw, meaty',
      price: 'Rs 250',
    },
    {
      id: 'm4',
      name: 'Green Bowl',
      description: 'Healthy...and green...',
      price: 'Rs 200',
    },
  ];
function AvailableMeal(){
    const List = DUMMY_MEALS.map(meals=><ul>
        <MealItem id={meals.id} key={meals.id} name={meals.name} description={meals.description} price={meals.price}></MealItem>
    </ul>)
    return(
        <div className={classes.meals}>
            <Cart>
            {List}
            </Cart>
        </div>


    );


}


export default AvailableMeal;
